	--[[
				打开二级功能界面测试红点通知
				第0位为是否有新邮件
				第1位为是否有新完成的日常任务
				第2位为是否有新完成的挑战任务
				第3位为福利小红点（不包括特权卡）
				第4位为是否有新的运营活动奖可以领取
				第5位为是否有竞技场积分奖励可以领取
				第6位为是否有首充奖励可以领取
				第7位为是否有在线奖励可以参与
				第8位为是否有在线奖励可以领取
				第9位为是否有团购活动（是否显示团购图标）
				第10位为是否有团购商品能购买（是否显示团购小红点）
				第11位为是否有限时商品能购买（是否显示限时特卖小红点）
				第12位为
				第13位为是否有约战NPC通知（是否显示约战NPC图标）
				第14位为
				第15位为是否有充值活动相关小红点
				第16位为是否有师徒相关小红点
	 ]]
	--Packet:role_notice

